import { Button } from '@material-ui/core';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import { styled } from '@mui/material/styles';
import heroImage from '../src/hero.svg'
import Box from '@material-ui/core/Box';
import me from '../src/me.svg';
import interviews from '../src/interviews.svg';
import notion1 from '../src/notion1.svg';
import notion2 from '../src/notion2.svg';
import notion3 from '../src/notion3.svg';

function Process() {
  return (
    <Container maxWidth="xl" style={{ background: '#F2E7D6', position: "flex", height: "300px"}}>
     <Grid container spacing = {10} alignContent="flex-end"  alignItems="flex-end" justifyContent="left" style={{paddingLeft: "8%"}}> 
      <Grid item xs={1}>
          <Box p={0}>
           <h1>The Process</h1>

          </Box>
        </Grid>
        <Grid item xs={2}>
          <Box p={0}>
            <img className="my-svg" src = {notion1} height = "150px" width = "150px"/>
          </Box>
        </Grid> 
    </Grid>
    <hr  style={{ width: '18%', marginLeft: "8%", borderColor: "black"}}/>
    </Container>
  )
}

export default Process;
